import React, { Component } from "react";
import Button from "react-bootstrap/Button";

class Activitydetails extends Component {
  render() {
    const Incorrectinfo = () => {
      return (
        <>
          <div className="chat-thread-right">
            <p>No, it looks incorrect</p>
          </div>
          <div className="chat-thread-left">
            <p>
              Please help us understand your concern by selecting your issue
            </p>
          </div>
        </>
      );
    };
    return (
      <>
        <div className="chat-thread-left">
          <p>Do the details of activity points looks correct to you?</p>
          <div className="button-wrapper">
            <Button>No</Button>
            <Button>Yes</Button>
          </div>
        </div>
        <Incorrectinfo
          options={[
            {
              firstOption: "Activity Points are incorrect",
            },
            {
              secondOption: "Activity Points are incorrect",
            },
            {
              thirdOption: "Activity Points are incorrect",
            },
            {
              fourthOption: "Activity Points are incorrect",
            },
          ]}
        />
      </>
    );
  }
}

export default Activitydetails;
